<script type="text/javascript">
var map, toolBar;
var themeManager;
var theme;
var oxCfg;
var configUrl = "../files/themeConfiguration.json";
var themes;
var grid;
var mapPanel = null;
function run() {
    OpenLayers.ProxyHost = "/osa/proxy?url=";
    oxCfg = new oscar.Control.OXFConfigManager();
    oxCfg.events.on({"haveThemes":drawMap});
    oxCfg.load(configUrl);
    
}
function drawMap(ox) {
    var theme = ox.themes[0];
    var options = {
            controls:[new oscar.Control.PanZoomBar]
    };
    map = new oscar.Map("map",options);
    themeManager = new oscar.Control.ThemeManager();
    map.addControl(themeManager);
    toolbar = new oscar.Control.ToolBar({usePreviousView:true});
    map.addControl(toolbar);
    map.addControl(new OpenLayers.Control.MousePosition());
    drawTheme(theme);
}


function drawTheme(t) {
    themeManager.drawTheme(t);
    toolbar.applyTheme(t);
    
}
